import React from 'react';
import './answerbuttons.css';

class AnswerButtons extends React.Component {
  constructor(props) {
    super(props);
    
    this.state = {
      answer: 'correct'
    }
  }


  render () {
    return (
      <div class="container">
        <div class="center">
          <button class="btn-square btn-red">
            <span class="fontawesome-group">lala</span>
          </button>

          <button class="btn-square btn-green">
            <span class="fontawesome-cogs"></span>
          </button>
          
          <button class="btn-square btn-orange">
            <span class="fontawesome-camera-retro"></span>
          </button>
          
          <button class="btn-square btn-blue">
            <span class="fontawesome-calendar"></span>
          </button>
          
          <p>An example of some square button made with css.</p>
        </div>
      </div>
    );
  }
}

export default AnswerButtons;
